-- テーブルの削除
--DROP TABLE CO_M_WAREKI_VIEW;

CREATE TABLE IF NOT EXISTS CO_M_WAREKI_VIEW
(
	GROUP_CD           CHAR(1)       NOT NULL,
    CODE               CHAR(8)       NOT NULL,
    GENGOU_CODE        CHAR(2)       NOT NULL,
    WAREKI_YEAR        CHAR(3)       NOT NULL,
    CODE_NAME          CHAR(20)      NOT NULL,
    VIEW_ORDER         int(4)        NOT NULL,
    INS_USER_ID        VARCHAR(20)   NOT NULL,
    INS_DATE           TIMESTAMP(3)  NOT NULL DEFAULT CURRENT_TIMESTAMP(3),
    UPD_USER_ID        VARCHAR(20)   ,
    UPD_DATE           TIMESTAMP(3)  DEFAULT CURRENT_TIMESTAMP(3) ON UPDATE CURRENT_TIMESTAMP(3), /* 更新タイムスタンプ自動設定 */
    UPD_FUNC_ID        VARCHAR(20)   NOT NULL
) ENGINE=InnoDB;

ALTER TABLE CO_M_WAREKI_VIEW ADD PRIMARY KEY(GROUP_CD, CODE, GENGOU_CODE);
ALTER TABLE CO_M_WAREKI_VIEW ADD INDEX CO_M_WAREKI_VIEW(CODE);

